import React, { forwardRef } from 'react';

const SkillCard = forwardRef(({ title, description, img }, ref) => {
    return (
        <div className="SkillCard" ref={ref}>
            <div className="icon">
                <img src={img} alt='Icon'></img>
            </div>
            <h4>{title}</h4>
            <p>
                {description}
            </p>
        </div>
    );
});

export default SkillCard;
